package app.loginimport androidx.compose.material3.SnackbarHostStateimport androidx.compose.runtime.Composableimport androidx.compose.runtime.rememberimport app.register.RegisterScreenimport cafe.adriel.voyager.core.screen.Screenimport cafe.adriel.voyager.navigator.LocalNavigatorimport cafe.adriel.voyager.navigator.currentOrThrowobject LoginScreen : Screen {	@Composable	override fun Content() {		val snackbarHostState = remember { SnackbarHostState() }		val navigator = LocalNavigator.currentOrThrow		LoginContent(			snackbarHostState = snackbarHostState,			state = LoginState(),			onEmailChange = {},			onPasswordChange = {},			onLoginClick = {},			onNavigateToRegister = { navigator.replace(RegisterScreen) },			onNavigateToHome = {}		)	}}